description:
We are holding Aikido classes on Monday and Saturday, at our Karate dojo / school in Lake City, SC. These classes focus primarily on teaching this traditional martial art and its principles of peaceful, natural movement and self defense. We are also holding Fitness classes on Tuesday, Thursday, and Saturday, which focus on progressive calisthenics for strength. We will continue our traditional karate classes on Monday, Wednesday, and Friday. Visit our website for more -
